import React from 'react'

function About() {
  return (
    <div>
      <h1>I am sukrit</h1>
      <p>I'm Sukrit, a passionate front-end developer with expertise<br/> in crafting engaging user experiences using React.js. Through my journey, I've honed my skills to create seamless and interactive<br/> web applications. My proficiency in React allows me to build dynamic and responsive designs that capture the essence of modern web development. I take pride in my work and have successfully delivered projects that align with clients' visions. Notably, my dedication led to the completion of several impactful<br/> projects. Currently, I'm dedicated to refining my craft and exploring new challenges in the world of front-end development. Feel free to reach out to me at sukrit37@gmail.com if you're looking to collaborate on a project or enhance your online presence. I'm excited to bring innovative solutions to the table!</p>
    </div>
  )
}

export default About
